import { makeStyles } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import Button from '@material-ui/core/Button';
import Typography from '@material-ui/core/Typography';
import IconButton from '@material-ui/core/IconButton';
import DeleteIcon from '@material-ui/icons/Delete';
import styles from './styles'

const useStyles = makeStyles(styles)

const ActivityCard = () => {
  const classes = useStyles()

  return (
    <Card className={classes.cardRoot} onClick={() => console.log('Card Clicked')}>
      <CardContent className={classes.cardContentRoot}>
        <Typography component="h3" variant="h5" className={classes.title}>
          Daftar Belanja Bulanan
        </Typography>
      </CardContent>
      <CardActions className={classes.cardActRoot}>
        <time>5 Oktober 2021</time>
        <IconButton aria-label="delete" className={classes.cardBtn}>
          <DeleteIcon />
        </IconButton>
      </CardActions>
    </Card>
  )
}
export default ActivityCard
